import React from "react";
import Header from './Header';
import MainPane from './MainPane';
import Scrollspy from 'react-scrollspy'



function TopPane(){
    return(
        <div id='TopPane'className='TopPane'>
                <Header/> 
                <MainPane/>
                <Scrollspy className='scrollspy' items={ ['TopPane', 'Ceremony', 'Reception','Afterparty'] } style={{'position':'fixed','top':'0px'}} currentClassName="is-current">
                    <li><a href="#TopPane" >section 1</a></li>
                    <li><a href="#Ceremony" >section 2</a></li>
                    <li><a href="#Reception" >section 3</a></li>
                    <li><a href="#Afterparty" >section 3</a></li>
                </Scrollspy>
        </div>
    )
}
export default TopPane;
